'use strict';
const {
  DataTypes
} = require('sequelize');
import sequelize from '../config/sequelize';


  const User =sequelize.define('User',{
    id: {
      allowNull: false,
      primaryKey: true,
      type: DataTypes.UUID,
      defaultValue:DataTypes.UUIDV4
    },
    firstName: DataTypes.STRING,
    lastName: DataTypes.STRING,
    email: DataTypes.STRING,
    password:DataTypes.STRING,
    gender:DataTypes.STRING,
    prefferedLanguage:DataTypes.STRING,
    prefferedCurrency:DataTypes.STRING,
    billingAddress:DataTypes.JSONB,
    profilePic:{
      type:DataTypes.STRING,
    defaultValue:"https://res.cloudinary.com/dmosnjgob/image/upload/v1719063344/9440461_z4o4b6.jpg"||"https://res.cloudinary.com/dmosnjgob/image/upload/v1719063344/9434619_wkhnaf.jpg",
  },
    role: {
      type: DataTypes.STRING,
      defaultValue: 'buyer',
    },
    isActive: {
      type: DataTypes.BOOLEAN,
      defaultValue: true,
    },
    isEmailVerified: {
      type: DataTypes.BOOLEAN,
      defaultValue: false,
    },
    mustUpdatePassword: {
      type: DataTypes.BOOLEAN,
      defaultValue: false,
    },
    lastTimePasswordUpdated:{
      type: DataTypes.DATE,
      defaultValue:new Date()
    },
    expired:{
      type:DataTypes.BOOLEAN,
      defaultValue:false
    },


  }, {

    tableName: 'Users',
    timestamps: true,
  });

  export default User

